transforms.result:
* {
  margin: 0;
  padding: 0;

  box-sizing: border-box;
}

@font-face {
  font-family: "dinbold";
  src: url("/fonts/dinbold.ttf") format("truetype");
  font-style: normal;
  font-display: swap;
}

@font-face {
  font-family: "dinlight";
  src: url("/fonts/dinlight.ttf") format("truetype");
  font-style: normal;
  font-display: swap;
}
@font-face {
  font-family: "sharpsans";
  src: url("/fonts/sharpsans.otf") format("opentype");
  font-style: normal;
  font-display: swap;
}
@font-face {
  font-family: "inter";
  src: url("/fonts/inter.ttf") format("truetype");
  font-style: normal;
  font-display: swap;
}

.block {
  width: 5px;
  height: 30px;
  background-color: #138064;
  margin-right: 16px;
}
.mainblock {
  display: flex;
}
